import Search from '../../assets/search-icon.svg';

import React from 'react';
const  SearchIcon=()=> {

    return (
        <form >
            <input type="text" placeholder="Search..."/>
            <button type="submit"><img src={Search} /></button>

        </form>
    );
}



export default SearchIcon;



